import React, { Component } from "react";

export default class Cart extends Component {
  render() {
    const { cartItems } = this.props;
    return (
      <div>
        {cartItems.length === 0 ? (
          <div>You have empty items added</div>
        ) : (
          <div>You have added {cartItems.length}</div>
        )}
      </div>
    );
  }
}
